import BoardPartList from '../components/BoardPartList';
import BoardPartForm from '../components/BoardPartForm';

const BoardParts = () => {
    return (
        <div>
            <h1>Board Parts</h1>
            <BoardPartForm />
            <BoardPartList />
        </div>
    );
};

export default BoardParts;
